import React from 'react'

const Home = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gradient-to-r from-blue-500 to-blue-700 text-white px-4">
    <h1 className="text-4xl font-extrabold mb-6 drop-shadow-lg">Página Inicial</h1>
   <p className="text-lg max-w-2xl text-center leading-relaxed">
    Uma plataforma desenvolvida para o <span className="font-semibold">apontamento</span> e
     <span className="font-semibold">gerenciamento</span> das horas complementares do curso de <span className="underline decoration-white">Análise e Desenvolvimento de Sistemas</span>.
  </p>
</div>

  )
}

export default Home
